description:
Five years ago Amanda Pierce was excitedly preparing to marry her college sweetheart in a lavish ceremony at The Breakers in Palm Beach. Then, with their guests and families on site, Amanda disappeared.

In present-day New York City, Laurie Moran realizes a missing bride is the perfect cold case for her investigative television series, Under Suspicion. She and her team set out to recreate the night of the disappearance at the Florida resort with Amanda's friends and family in attendance, hoping to shed new light on the mystery as the series has done in past episodes. With a jealous sister, playboy groomsmen, Amanda's former fiancÃ© now married to a bridesmaid, and rumors about the &quot;beloved&quot; bride herself, Laurie and Under Suspicion host Alex Buckley quickly realize everyone has a theory about why Amanda vanished into thin air.

One thing is certain: whoever was behind Amanda's disappearance plans to keep the truth hidden &quot;until death do they part...&quot;
